using System;
using System.Collections.Generic;
using System.Linq;
using System.Text;
using System.Threading.Tasks;

namespace AlgoDemos.codecamp
{
    internal class JumpGame7
    {
        public bool CanReach(string s, int minJump, int maxJump)
        {
            minJump = 1;
            maxJump = 9999;
            s = "";
            int l = s.Length;
            int[] canReach = new int[l];
            canReach[l - 1] = 1;
            for (int i = 0; i < l - 1; i++)
            {
                canReach[i] = 0;
            }
            for (int i = l - 2; i >= 0; i--)
            {
                int canreachDest = 0;
                for (int j = i + minJump; j <= i + maxJump; j++)
                {
                    if (j > l - 1 || s[j] != '0')
                    {
                        continue;
                    }
                    canreachDest = canReach[j];
                    if (canreachDest == 1)
                    {
                        break;
                    }
                }
                canReach[i] = canreachDest;
            }
            return canReach[0] == 0 ? false : true;
        }
    }
}
